import React from "react";
import { Card } from "semantic-ui-react";

function Code() {
  return (
    <div className="Code">
      <h1>Code Examples</h1>
      <Card.Group>
        <Card>
          <Card.Content>
            <Card.Header>Fizzbuzz</Card.Header>
            <Card.Meta>Function</Card.Meta>
            <Card.Description>
              <code>
                {`html { background: red; }`}
                <br />
                {`body { color: blue; }`}
                <br />
              </code>{" "}
            </Card.Description>
          </Card.Content>
        </Card>
      </Card.Group>
    </div>
  );
}

export default Code;
